const videos = [
    {
        name: 'Video1',
        duration: 15,
        id:1,

    },
    {
        name: 'ПорноПриколы',
        duration: 15,

    },
    {
        name: 'Роблокс',
        duration: 15,

    }
]
export function VideoList(){
    return (
        <>
        <h1>VideoList</h1>
        {
            videos.map((video)=>{
                return(
                    <div>
                        <p>{video.name}</p>
                        <p>{video.duration}</p>
                        <button>Просмотреть</button>
                    </div>
                )
            })
        }
        </>
    )
}
